/**用于封装公用的组件**/
var T={//公用提示弹窗
    alert1:function (msg,code) {//两个参数msg提示信息,code哪种提示
        //"https://111.47.16.22:1000/newStatic/icon/chenggong_icon.png";
        var src1 = "data:image/png;base64,";
        var src2 = "data:image/png;base64,";
        var item = "";
        var display = $("#alert_div").css("display");
        if(display == "none"){
            if(code == "1"){//成功

                item="<img src='"+src1+"' /><span class='alert_span'>"+msg+"</span>"
                $("#alert_div").append(item);
                $("#alert_div").fadeIn(200);
                setTimeout("removeAlert()",1500)

            }else if(code == "2"){

                item="<img src='"+src2+"' /><span class='alert_span'>"+msg+"</span>"
                $("#alert_div").append(item);
                $("#alert_div").fadeIn(200);
                setTimeout("removeAlert()",3000)

            }
        }
    },
    //文字提示弹窗
    text:function (text) {//text
        var item = "<div id='textMsg'>" +
            "<h4>提示信息</h4><i onclick='removeText()'><img src='http://192.168.3.120:1000/newStatic/icon/guanbi_icon.png' alt=\"\"></i>"+
            "<div><p>"+text+"</p></div>"+
            "</div>";
        var item1 = "<div id='popupText'></div>";
        $("body").append(item);
        $("body").append(item1);
    },
    //播放mp3或mp4
    video:function (url, type) {

    }
};
//关闭提示
function removeText() {
    $("#textMsg").remove();
    $("#popupText").remove();
}
//关闭提示
function removeAlert() {
    $("#alert_div").html("");
    $("#alert_div").fadeOut(200);
}
//显示加载
function showLoading() {
    var item = "<div id=\"loading\">\n" +
        "    <img src='data:image/gif;base64,' alt=\"\">\n" +
        "</div>";
    $('body').append(item);
}
//隐藏加载
function hideLoading() {
    $("#loading").remove()
}
//二次封装jquery.ajax
var ajax = {
    data:function (type,async,url, dataType,dataStr, funData) {
        //type 请求类型
        //async 是否异步
        //url 请求路径
        //dataType 返回类型
        //dataStr 请求参数
        //func 回调函数
        type = (type==null || type=="" || typeof(type)=="undefined")? "post" : type;
        async = (async==null || async=="" || typeof(async)=="undefined")? "true" : async;
        dataType = (dataType==null || dataType=="" || typeof(dataType)=="undefined")? "json" : dataType;
        dataStr = (dataStr==null || typeof(dataStr)=="undefined")? {"date": new Date().getTime()} : dataStr;
        $.ajax({
            type: type,
            url: url,
            async:async,
            dataType: dataType,
            data: dataStr,
            timeout: 10000,
            success: function (data) {
                if(data.code){
                    if(data.code == 0){
                        funData(data);
                        hideLoading()
                    }else if(data.code == 1){
                        hideLoading();
                        T.alert1(data.msg,2);
                    }else {
                        hideLoading();
                        T.alert1(data.msg,2);
                    }
                }else {
                    funData(data);
                    hideLoading()
                }
            },
            error: function () {
                //请求失败时被调用的函数
                hideLoading();
                T.alert1("操作失败",2);
            }
        });
    }
};

//获取当前时间
//得到当前的日期
var date = {
    getNowFormatDate:function (funcDate,type) {//第一个参数是返回接受时间的函数，第二个是判断是获取日期还是完整时间
        var date = new Date();
        var seperator1 = "-";
        var seperator2 = ":";
        var month = date.getMonth() + 1;
        var strDate = date.getDate();
        var hour = date.getHours();
        var minute = date.getMinutes();
        var second = date.getSeconds();
        if (month >= 1 && month <= 9) {
            month = "0" + month;
        }
        if (strDate >= 0 && strDate <= 9) {
            strDate = "0" + strDate;
        }
        if (hour >= 0 && hour <= 9) {
            hour = "0" + hour;
        }
        if (minute >= 0 && minute <= 9) {
            minute = "0" + minute;
        }
        if (second >= 0 && second <= 9) {
            second = "0" + second;
        }
        if(type == 1){
            var currentdate = date.getFullYear() + seperator1 + month + seperator1 + strDate
        }else if(type == 2){
            var currentdate = date.getFullYear() + seperator1 + month + seperator1 + strDate
                + " " + hour + seperator2 + minute;
        }else {
            var currentdate = date.getFullYear() + seperator1 + month + seperator1 + strDate
                + " " + hour + seperator2 + minute + seperator2 + second;
        }
        //返回
        funcDate(currentdate)
    }
};

String.prototype.replaceAll  = function(s1,s2){
    return this.replace(new RegExp(s1,"gm"),s2);
}

function getRootPath(){
    //获取当前网址，如： http://localhost:8083/uimcardprj/share/meun.jsp
    var curWwwPath=window.document.location.href;
    //获取主机地址之后的目录，如： uimcardprj/share/meun.jsp
    var pathName=window.document.location.pathname;
    var pos=curWwwPath.indexOf(pathName);
    //获取主机地址，如： http://localhost:8083
    var localhostPaht=curWwwPath.substring(0,pos);
    //获取带"/"的项目名，如：/uimcardprj
    var projectName=pathName.substring(0,pathName.substr(1).indexOf('/')+1);
    return(localhostPaht+projectName);
}

function changeHtml(obj) {

    var id =$(obj).next().val();
    //console.log(id);
    if(id == 1){
        window.location.href = "/web/product?id="+id;
    }else if(id == 2){
        window.location.href = "/web/project?id="+id;
    }else if(id == 3){
        window.location.href = "/web/viewpoint?id="+id;
    }else if(id == 4){
        window.location.href = "/web/case?id="+id;
    }else if(id == 5){
        window.location.href = "/web/service?id="+id;
    }else if(id == 6){
        window.location.href = "/web/connection?id="+id;
    }
}
